import React from 'react';
import { StyleSheet, Text, View,Button } from 'react-native';
import Inputs from './Diseño/Inputs';
import Buttons from './Diseño/buttons'
import { NavigationContainer } from '@react-navigation/native';
export default function Registro() {
  return (
    <View style={styles.container}>
      <Text style={styles.titulo}>Roomie</Text>
      <Inputs placeholder={"Nombre"} />
      <Inputs placeholder={"Apellido"} />
      <Inputs placeholder={"Correo"} />
      <Inputs placeholder={"Contraseña"} icon={"lock"} password={true} />
      <Buttons texto={"Registrarse"} estilo={"con_estilo"}
      />
      <Buttons texto={"Ya tienes cuenta? Inicia Sesión Aquí"} estilo={"sin_estilo"} />
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#43CA88',
    justifyContent: 'center',
  },
  titulo:{
    marginTop:-300,
    color:'white',
    fontFamily:'Zapfino',
    fontWeight:'bold',
    fontSize:30,
    textAlign:'center'
  }
});
